export default class Porfolio extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <section id="portfolio">
      <div className="row">
      <div class="column">
      <img src="sample-image.jpg" alt="Snow" style="width:100%" />
      </div>
      <div class="column">
      <img src="profilepic.jpg" alt="Forest" style="width:100%" />
</div>
<div class="column">
